      <input
        id="password"
        type="password"
        placeholder="Mot de passe"
        className="formStyle formInput"
      ></input>
      <button
        className="formStyle btn blue"
        onClick={() => {
          console.log("Button Clicked");
        }}
      >
        Connexion
      </button>
    </div>
  );
};

export default Login;
